import React from 'react';
import {Navbar} from 'react-bootstrap';
import logo from './images/logo.svg';

const Nav = () => {
        return(
            <div className = 'navigation'>
            <Navbar bg="light" expand="lg">
            <Navbar.Brand><img src={logo} alt=''></img></Navbar.Brand>
            </Navbar>
            </div>
        )
}

export default Nav;
